import AwTextbox from 'viewmodel/AwTextboxViewModel';

/**
 * render function for AwPassword
 * @param {*} param0 context for render function interpolation
 * @returns {JSX.Element} react component
 */
export const awPasswordRenderFunction = ( props ) => {
    const {
        viewModel,
        ctxMin,
        actions,
        i18n,
        fields,
        grids,
        formProp,
        messages,
        ...prop
    } = props;
    return <AwTextbox {...prop} inputType='password'></AwTextbox>;
};
